Pokevisit.Views.ListingNew = Backbone.CompositeView.extend({
  template: JST["listings/new"],

  className:"listing-new",

  events: {
    "click .hometype-btn-group button": "getHomeType",
    "click .roomtype-btn-group button": "getRoomType",
    "change #select-accomodates-option": "updateAccomodates",
    "keyup #new-price": "getPrice",
    "click .create-listing-btn": "createListing",
    "click button#select-pictures": "selectPictures"
  },

  initialize: function(options){
    //once this page is submitted, on success of creation, should link user to show page
    //of the listing he/she just made and let them edit the summary etc which can be show on other
    //pages
    this.setFilepicker();

    this._imageUrls = [];
    this._numImages = 0;

    this._params = Object.create(null);
    this._params["listing"] = {
      "hometype": null,
      "roomtype": null,
      "accomodates": 1,
      "date_avail": null,
      "date_end": null,
      "address": null,
      "price": null
    }
    window.testParams = this._params.listing
  },

  getHomeType: function(event){
    var $clickedButton = $(event.currentTarget);
    $clickedButton.addClass("active")
    $clickedButton.siblings().removeClass("active")
    this._params.listing["hometype"] = $clickedButton.data("home")
    this.convertButton();
  },

  getRoomType: function(event){
    var $clickedButton = $(event.currentTarget);
    $clickedButton.addClass("active")
    $clickedButton.siblings().removeClass("active")
    this._params.listing["roomtype"] = $clickedButton.data("room")
    this.convertButton();
  },

  updateAccomodates: function(event){
    this._params.listing["accomodates"] = parseInt($(event.currentTarget).val());
    this.convertButton();
  },

  getPrice: function(event){
    var $input = $(event.currentTarget)
    this._params.listing["price"] = parseInt($input.val())
    this.convertButton();
  },

  setFilepicker: function(){
    if (filepicker){
      //if loaded set key
      filepicker.setKey("AJXpnUispSeOzkYcpSa8Kz");
    }
  },

  convertButton: function(){
    if (this.paramsCompleted()){
      this.$("button.create-listing-btn").removeClass("disabled")
      this.$("button.create-listing-btn").removeAttr("disabled", "disabled")
    } else {
      this.$("button.create-listing-btn").addClass("disabled")
      this.$("button.create-listing-btn").attr("disabled", "disabled")
    }
  },

  createListing: function(event){
    event.preventDefault();
    if (!this.paramsCompleted()){
      return
    } else {
      //create listing, on success create images, on success of images, redirect to show view

      this.model.set(this._params)
      this.model.save({},{
        success: function(){

          Pokevisit.ownListings.add(this.model)

          var successCB = function(modelId){
            //need to edit to your listings later or add options if it's your listing
            Backbone.history.navigate("#/listings/" + modelId, { trigger: true })
          }

          if (this._imageUrls.length === 0){
            this._imageUrls.push("/assets/plains/plains_4.jpg")
          }

          this.createImages(this.model.id, this._imageUrls, successCB)
        }.bind(this)
      })
    }
  },

  createImages: function(listingId, urls, successCB){
    var image = new Pokevisit.Models.Image();
    var imageParams = {
      "image": {
        "listing_id": listingId,
        "url": urls.shift()
      }
    }
    image.set(imageParams)
    image.save({},{
      success: function(){
        if (urls.length > 0){
          this.model.images().add(image)
          this.createImages(listingId, urls, successCB)
        } else {
          successCB(listingId)
        }
      }.bind(this)
    })
  },

  paramsCompleted: function(){
    var listingObj = this._params.listing
    for(key in listingObj){
      if (!listingObj[key]){
        return false
      }
    }

    return true;
  },

  attachDatepicker: function(){
    //need to grab date picker logic

    var nowTemp = new Date();
    var now = new Date(nowTemp.getFullYear(), nowTemp.getMonth(), nowTemp.getDate(), 0, 0, 0, 0);

    var checkin = this.$('#date-avail-new').datepicker({
      onRender: function(date) {
        return date.valueOf() < now.valueOf() ? 'disabled' : '';
      }
    }).on('changeDate', function(ev) {
      this._params.listing["date_avail"] = ev.date
      this.convertButton();

      if (ev.date.valueOf() > checkout.date.valueOf()) {
        var newDate = new Date(ev.date)
        newDate.setDate(newDate.getDate() + 1);
        checkout.setValue(newDate);
        this._params.listing["date_end"] = newDate;
        this.convertButton();
      }
      checkin.hide();
      this.$('#date-end-new')[0].focus();
    }.bind(this)).data('datepicker');
    var checkout = this.$('#date-end-new').datepicker({
      onRender: function(date) {
        return date.valueOf() <= checkin.date.valueOf() ? 'disabled' : '';
      }
    }).on('changeDate', function(ev) {
      checkout.hide();
      //need to trigger for checkout
      this._params.listing["date_end"] = ev.date
      this.convertButton();
    }.bind(this)).data('datepicker');
  },

  attachAutocomplete: function(){
    var input = this.$("#address-search").get(0);
    this._autoComplete = new google.maps.places.Autocomplete(input);

    google.maps.event.addListener(this._autoComplete, "place_changed", function(){
      var location = this._autoComplete.getPlace();
      this._params.listing["address"] = location.formatted_address
      this.convertButton();
    }.bind(this))
  },

  selectPictures: function(){
    filepicker.pickMultiple(
      function(Blobs){
        _.each(Blobs, function(blob){
          this._imageUrls.push(blob.url)
          this.$("div.img-preview").append(blob.url + ", ")
        }.bind(this))
      }.bind(this)
    );
  },

  render: function(){
    this.setFilepicker();
    //make sure filepicker key is set
    var renderedContent = this.template()
    this.$el.html(renderedContent)


    setTimeout(function(){
      this.$("#select-accomodates-option").selectpicker();
      this.attachDatepicker();
      this.attachAutocomplete();
    }.bind(this),0)
    return this;
  }
})
;
Pokevisit.Views.ListingRequest = Backbone.CompositeView.extend({
  template: JST["listings/request"],

  //gray out button until person selects date and guests
  events: {
    "click button.book-button": "createReservation"
  },

  initialize: function(){
    //gray out button
    this.listenTo(this.model, "sync", this.render)
    this._checkIn = undefined;
    this._checkOut = undefined;

    //need to go through reservations for a listing then see if any of date ranges
    //have been accepted
  },

  attachDate: function(){

    this.reservations = this.model.reservations();
    this.unavailableDayRanges = [];

    this.reservations.each(function(reservation){
      if (reservation.escape("status") == "APPROVED"){
        this.unavailableDayRanges.push([new Date(reservation.get("start_date")), new Date(reservation.get("end_date"))])
      }
    }.bind(this))

    var nowTemp = new Date();
    var now = new Date(nowTemp.getFullYear(), nowTemp.getMonth(), nowTemp.getDate(), 0, 0, 0, 0);
    var listing = this.model;
    var dayRanges = this.unavailableDayRanges;

    var checkin = this.$('#check-in-select').datepicker({
      onRender: function(date) {
        dateFlag = ""
        _.each(dayRanges, function(dayRange){
          if(date >= dayRange[0] && date<= dayRange[1]){
            dateFlag = "disabled";
          }
        });

        if(dateFlag === "disabled"){
          return dateFlag;
        }

        if (date.valueOf() < new Date(listing.escape("date_avail")).valueOf() ||
            date.valueOf() > new Date(listing.escape("date_end"))) {
          return "disabled";
        } else {
          return "";
        }
        return date.valueOf() < now.valueOf() ? 'disabled' : '';
      }
    }).on('changeDate', function(ev) {

      //need to update checkin and update button
      this._checkIn = ev.date;

      //must make sure date is within the listing's selected dates

      if (ev.date.valueOf() > checkout.date.valueOf()) {
        var newDate = new Date(ev.date)
        newDate.setDate(newDate.getDate() + 1);
        checkout.setValue(newDate);
        this._checkOut = newDate
      }
      checkin.hide();

      this.$('#check-out-select')[0].focus();
    }.bind(this)).data('datepicker');

    //set a default for the checkin-date
    this.$('#check-in-select').datepicker("setValue", new Date(listing.escape("date_avail")))
    this._checkIn = new Date(listing.escape("date_avail"));

    var checkout = this.$('#check-out-select').datepicker({
      onRender: function(date) {
        dateFlag = ""
        _.each(dayRanges, function(dayRange){
          if(date >= dayRange[0] && date<= dayRange[1]){
            dateFlag = "disabled";
          }
        });

        if(dateFlag === "disabled"){
          return dateFlag;
        }

        if (date.valueOf() > new Date(listing.escape("date_end").valueOf()) ||
            date.valueOf() < new Date(listing.escape("date_avail")).valueOf()){
          return "disabled";
        } else {
          return "";
        }
        return date.valueOf() <= checkin.date.valueOf() ? 'disabled' : '';
      }.bind(this)
    }).on('changeDate', function(ev) {
      checkout.hide();
      //need to update checkout and update button

      this._checkOut = ev.date;

    }.bind(this)).data('datepicker');

    var listingStartDate = new Date(listing.escape("date_avail"));
    listingStartDate.setDate(listingStartDate.getDate() + 1);
    this.$('#check-out-select').datepicker("setValue", listingStartDate);
    this._checkOut = listingStartDate;

  },

  attachSelect: function(){
    this.$("#select-accomodates").selectpicker()
  },

  createReservation: function(event){
    event.preventDefault();
    var $button = $(event.currentTarget)
    if(!this._checkIn || !this._checkOut){
      return;
    } else {
      var guests = this.$("#select-accomodates").val();

      var reservationParams = {
        "reservation": {
          "listing_id": this.model.id,
          "start_date": this._checkIn,
          "end_date": this._checkOut,
          "guests": guests
        }
      }

      var newReservation = new Pokevisit.Models.Reservation();
      newReservation.set(reservationParams)
      newReservation.save({}, {
        success: function(){
          //successful reservation
          Pokevisit.yourPendingReservations.add(newReservation)
          this.changeButtonSuccessCSS();
        }.bind(this),

        error: function(){
          this.changeButtonErrorCSS();
        }.bind(this)
      })
    }

  },


  changeButtonSuccessCSS: function(){
    this.$("button.book-button").html("Successful Reservation")
    this.$("button.book-button").css("background", "#007a87")
    this.$("button.book-button").css("border-color", "#007a87")
    this.$("button.book-button").css("border-bottom-color", "#004f58")
    this.$("button.book-button").attr("disabled", "disabled")
  },

  changeButtonErrorCSS: function(){
    this.$("button.book-button").html("Check Your Dates!")
    this.$("button.book-button").css("background", "#f39c12")
    this.$("button.book-button").css("border-color", "#f39c12")
    this.$("button.book-button").css("border-bottom-color", "#f39c12")
  },

  render: function(){
    var renderedContent = this.template({
      listing: this.model,
    });

    this.$el.html(renderedContent);

    setTimeout(function(){
      if( this.model.get("user_id")){
        this.attachDate()
      }
      this.attachSelect()
    }.bind(this), 0)

    return this;
  }
})
;
Pokevisit.Views.ListingReview = Backbone.CompositeView.extend({
  template: JST["listings/review"],

  events: {
    "keyup textarea.new-listing-review-text": "updateText",
    "click button#create-review": "createReview",
  },

  initialize: function(){
    this.reviewsSelector = "div.listing-review-content"
    this.listenTo(this.model, "sync", this.render)
    this.listenTo(this.model.reviews(), "add", this.addView)
    this.listenTo(this.model.reviews(), "remove", this.removeView)

    this.model.reviews().each(function(review){
      this.addView(review)
    }.bind(this))

    this._reviewParams = {
      "review": {
        "listing_id": this.model.id,
        "review_text": null,
        "rating": null
      }
    }

  },

  createReview: function(event){
    event.preventDefault();
    var newReview = new Pokevisit.Models.Review();
    newReview.set(this._reviewParams);
    newReview.save({}, {
      success: function(){
        this.model.reviews().add(newReview);
        this.updatePointsClientSide();
        this.$("textarea.new-listing-review-text").html("")
        this.$("#create-review").attr("disabled", true);
        this.$("div.no-review").remove();
        if (this.$("div.yes-review").length === 0){
          //if the reviews aren't there we want to show it
          this.$("div.current-review-pts").prepend("<div class=\"yes-review-text\">Current Rating: </div><div class=\"yes-review\"></div>")
          setTimeout(function(){
            this.$("div.yes-review").raty({
              score: newReview.get("rating")
            })
          }.bind(this), 0)
        }

        $('html, body').animate({
          scrollTop: $(document).height()-$(window).height()},
          1400
        );


      }.bind(this)
    })
  },

  updatePointsClientSide: function(){
    var totalPoints = 0
    this.model.reviews().each(function(review){
      totalPoints += review.get("rating")
    })
    this.$("div.yes-review").raty({
      score: totalPoints / this.model.reviews().length
    })
  },

  addView: function(review){
    var reviewItemView = new Pokevisit.Views.ListingReviewItem({
      model: review
    })
    this.addSubview(this.reviewsSelector, reviewItemView)
  },

  removeView: function(review){
    _.each(this.subviews(this.reviewsSelector), function(view){
      if (view.model.id === review.id){
        this.removeSubview(view)
      }
    }.bind(this))
  },

  attachRating: function(){
    this.$("#new-listing-rating").raty({
      half: true,
      click: function(score, event){
        this._reviewParams.review.rating = score + 1;
        this.updateButton();
      }.bind(this)
    })
  },

  updateButton: function(){
    var $button = this.$("#create-review")
    if (this._reviewParams.review.listing_id && this._reviewParams.review.rating &&
        this._reviewParams.review.review_text && this._reviewParams.review.review_text.length > 0){
      $button.removeAttr("disabled")
      $button.html("Add Review")
    } else {
      $button.attr("disabled", true)
      $button.html("Please rate/write before submitting")
    }
  },

  updateText: function(event){
    this._reviewParams.review.review_text = $(event.currentTarget).val();
    this.updateButton();
  },

  attachListingRating: function(){
    this.$("div.yes-review").raty({
      score: this.model.get("avg_rating"),
      readOnly: true
    })

  },

  render: function(){

    var renderedContent = this.template({
      listing: this.model
    })
    this.$el.html(renderedContent);
    this.attachSubviews();

    setTimeout(function(){
      //rating
      this.attachRating();
      this.attachListingRating();
    }.bind(this),0)

    return this;
  }
})
;
